import React from 'react';
// import logo from './logo.svg';
import './App.css';
import ChoiceCard from './components/ChoiceCard'
import List from './components/List'

function App() {
    return ( 
    <div>
        <ChoiceCard name = "first"
        color = "red" />
        <ChoiceCard name = "second"
        color = "blue" />
        <ChoiceCard name = "third"
        color = "green" />
        <ul>
        <List />
        <List />
        <List />
        </ul>
        </div>
    );
}

export default App;
